### Descrição:

Estamos tendo progresso! Nessa issue, discutiremos sobre os dados JSON. Para isso, precisamos decidir quais dados extraíremos do arquivo. Até então, nosso objetivo é mostrar:

- Um gráfico com quantidade de licitações ao decorrer dos meses;
- Um card com o total de licitações;
- Um gráfico de quantidade de licitações por produtos da licitação;
- Um card com o valor total das licitações;

### Objetivos:

Para isso, precisaremos extrair do arquivo, os seguintes dados: 

- [x] Nome do município
- [x] Ano da licitação
- [x] Tipo de Licitação
- [x] Valor da Licitação
- [x] Modalidade
- [x] Nome do Órgão

